import "./styles.scss";
import React, { useState } from "react";

const Card = ({ cardTags, cardTitle, cardDesc, DocumentLink, cardVersion }) => {
  const renderCardTags = () => {
    return (
      <div className="card-tags">
        {cardTags.map(({ title, colorCode }) => {
          return (
            <span style={{ backgroundColor: colorCode, color: "white" }}>
              {title}
            </span>
          );
        })}
      </div>
    );
  };

  return (
    <div className="card-wrapper">
      {renderCardTags()}
      <div className="card-title-version">
        {cardTitle}
        {cardVersion}
      </div>
      {cardDesc}
      {DocumentLink}
    </div>
  );
};

export default Card;
